import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardText,
  MDBListGroup,
  MDBListGroupItem,
  MDBProgress,
  MDBProgressBar,
  MDBIcon,
} from "mdb-react-ui-kit";

export default function Details() {
    const { id } = useParams();
    const [status, setStatus] = useState({});
    const [customer, setCustomer] = useState({});
    const [loading, setLoading] = useState(true);

    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/loan/${id}`);
        setStatus(response.data);

        const customerNo = response.data.customerId;

        const responseCustomer = await axios.get(
          `http://localhost:3001/customer/${customerNo}`
        );

        setCustomer(responseCustomer.data);
        setLoading(false);
      } catch (error) {
        console.error("Error:", error);
      }
    };

    useEffect(() => {
      fetchData();
    }, [id]);
  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <section style={{ backgroundColor: "#eee" }}>
      <MDBContainer className="py-5">
        <MDBRow>
          <MDBCol lg="4">
            <MDBCard className="mb-4">
              <MDBCardBody className="text-center">
                <MDBCardImage
                  src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava3.webp"
                  alt="avatar"
                  className="rounded-circle"
                  style={{ width: "150px" }}
                  fluid
                />
                <p className="text-muted mb-1">Full Stack Developer</p>
                <p className="text-muted mb-4">{status.customerId}</p>
                <div className="d-flex justify-content-center mb-2">
                  <MDBIcon fas icon="globe fa-lg text-warning" />
                  <MDBCardText>{customer.name}</MDBCardText>
                </div>
                <div className="d-flex justify-content-center mb-2">
                  <MDBIcon
                    fab
                    icon="github fa-lg"
                    style={{ color: "#333333" }}
                  />
                  <MDBCardText>{status.github}</MDBCardText>
                </div>
                <div className="d-flex justify-content-center mb-2">
                  <MDBIcon
                    fab
                    icon="twitter fa-lg"
                    style={{ color: "#55acee" }}
                  />
                  <MDBCardText>{status.twitter}</MDBCardText>
                </div>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
          <MDBCol lg="8">
            <MDBCard className="mb-4">
              <MDBCardBody>
                <MDBListGroup flush className="rounded-3">
                  <MDBListGroupItem className="d-flex justify-content-between align-items-center p-3">
                    <MDBCardText>Full Name</MDBCardText>
                    <MDBCardText className="text-muted">
                      {customer.name}
                    </MDBCardText>
                  </MDBListGroupItem>
                  <MDBListGroupItem className="d-flex justify-content-between align-items-center p-3">
                    <MDBCardText>Email</MDBCardText>
                    <MDBCardText className="text-muted">
                      {customer.email}
                    </MDBCardText>
                  </MDBListGroupItem>
                  <MDBListGroupItem className="d-flex justify-content-between align-items-center p-3">
                    <MDBCardText>Phone</MDBCardText>
                    <MDBCardText className="text-muted">
                      {customer.phone}
                    </MDBCardText>
                  </MDBListGroupItem>
                  <MDBListGroupItem className="d-flex justify-content-between align-items-center p-3">
                    <MDBCardText>Mobile</MDBCardText>
                    <MDBCardText className="text-muted">
                      {customer.mobile}
                    </MDBCardText>
                  </MDBListGroupItem>
                  <MDBListGroupItem className="d-flex justify-content-between align-items-center p-3">
                    <MDBCardText>Address</MDBCardText>
                    <MDBCardText className="text-muted">
                      {customer.address}
                    </MDBCardText>
                  </MDBListGroupItem>
                </MDBListGroup>
              </MDBCardBody>
            </MDBCard>
            {/* Add Project Status section here */}
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </section>
  );
}
